import React from 'react'
import { observer } from "mobx-react-lite";
import '../index.css'

const SquareView = observer(({ node, drawingMode, gridFunction, mouseEvents }) => (
    //<Button variant="outline-primary"/>
    <div 
        id={'node-' + node.col + '-' + node.row} 
        className='node'
        onMouseDown={() => {mouseEvents.mouseDown(node.col, node.row, drawingMode, gridFunction)}}
        onMouseUp={() => {mouseEvents.mouseUp()}}
        onMouseOver={() => {mouseEvents.mouseOver(node.col, node.row, drawingMode, gridFunction)}}>
    </div>
))

export default SquareView
